import {
    TYPE_REQUEST,
    NAME_WINDOW
} from "../types";


export const saveTypeRequest = (data) => {

    return {
        type: TYPE_REQUEST,
        payload: data
    }
}
export const saveNameWindow = (data) => {

    return {
        type: NAME_WINDOW,
        payload: data
    }
}
